import React, { useState, useEffect } from 'react';
import { Routes, Route, Navigate, Link } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import PatientDashboard from './components/PatientDashboard';
import ProtectedRoute from './components/ProtectedRoute';

function App() {
  const [user, setUser] = useState(null);
  const [loadingUser, setLoadingUser] = useState(true);

  useEffect(() => {
    const storedUser = localStorage.getItem('user');
    if (storedUser) {
      try {
        setUser(JSON.parse(storedUser));
      } catch (err) {
        localStorage.removeItem('user');
        setUser(null);
      }
    }
    setLoadingUser(false);
  }, []);

  const handleLogin = (userData) => setUser(userData);
  const handleLogout = () => {
    setUser(null);
    localStorage.removeItem('user');
  };

  if (loadingUser) return <p>Loading...</p>;

  const Navbar = () => (
    <nav className="bg-white shadow sticky top-0 z-50">
      <div className="container mx-auto flex justify-between items-center p-4">
        <Link to="/" className="text-xl font-bold text-blue-600">Dental Clinic</Link>
        <div className="flex gap-4">
          <Link to="/" className="hover:text-blue-500">Home</Link>
          {!user && <Link to="/login" className="hover:text-blue-500">Login</Link>}
          {!user && <Link to="/register" className="hover:text-blue-500">Sign Up</Link>}
          {user && <Link to="/dashboard" className="hover:text-blue-500">Dashboard</Link>}
          {user && <button onClick={handleLogout} className="hover:text-red-500">Logout</button>}
        </div>
      </div>
    </nav>
  );

  const Home = () => (
    <div className="max-w-4xl mx-auto mt-10 p-6 bg-white rounded shadow">
      <h1 className="text-3xl font-bold mb-4 text-center">Welcome to Dental Clinic</h1>

      <div className="mb-6">
        <h2 className="text-2xl font-bold mb-2">Patient Reviews</h2>
        <ul className="list-disc list-inside">
          <li>“Excellent service and friendly staff!”</li>
          <li>“Very professional dentists, highly recommend.”</li>
          <li>“Clean clinic and great experience.”</li>
        </ul>
      </div>

      <div className="mb-6">
        <h2 className="text-2xl font-bold mb-2">Clinic Location</h2>
        <div className="w-full h-64">
          <iframe
            title="clinic-map"
            src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3875.1298456035655!2d100.516111!3d13.756331!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x30e29ed2ff3a3e59%3A0x23d7c4a2c6b8!2sBangkok%2C%20Thailand!5e0!3m2!1sen!2sus!4v1693555200000!5m2!1sen!2sus"
            width="100%"
            height="100%"
            style={{ border: 0 }}
            allowFullScreen=""
            loading="lazy"
            referrerPolicy="no-referrer-when-downgrade"
          ></iframe>
        </div>
      </div>
    </div>
  );

  return (
    <div>
      <Navbar />
      <div className="container mx-auto p-4">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={user ? <Navigate to="/dashboard" /> : <Login onLogin={handleLogin} />} />
          <Route path="/register" element={user ? <Navigate to="/dashboard" /> : <Register />} />
          <Route
            path="/dashboard"
            element={
              <ProtectedRoute user={user} role="patient">
                <PatientDashboard user={user} onLogout={handleLogout} />
              </ProtectedRoute>
            }
          />
          <Route path="*" element={<Navigate to="/" />} />
        </Routes>
      </div>
    </div>
  );
}

export default App;
